import React from "react";
import classes from "./ButtonIcon.module.css";
import { AddCircleOutlineIcon, EditIcon } from "@material-ui/icons";

const buttonIcon = (props) => {
  let icon = null;
  switch (props.btnType) {
    case "AddCircleOutlineIcon":
      icon = <AddCircleOutlineIcon {...props} />;
      break;
    case "EditIcon":
      icon = <EditIcon {...props} />;
      break;
    default:
      icon = null;
  }
  return { icon };
};

export default buttonIcon;
